import { Injectable } from '@angular/core'

@Injectable({
  providedIn: 'root'
})
export class FartService {

  sounds = [
    // tslint:disable-next-line:max-line-length
    'data:audio/mpeg;base64,',
    // tslint:disable-next-line:max-line-length
    'data:audio/mpeg;base64,',
    // tslint:disable-next-line:max-line-length
    'data:audio/mpeg;base64,',
    // tslint:disable-next-line:max-line-length
    'data:audio/mpeg;base64,',
    // tslint:disable-next-line:max-line-length
    'data:audio/mpeg;base64,'
  ]

  fart = () => {
    const index = Math.floor(Math.random() * this.sounds.length)
    const player = document.getElementById('audio') as HTMLAudioElement
    player.src = this.sounds[index]
    player.currentTime = 0
    player.play().then().catch(err => console.log(err))
  }
}
